      SELECT * FROM tab2 (FORMAT parquet) cor0 WHERE NOT col0 + col0 * 63 - + - col2 * - col1 IN ( 16, 73 + - col0, + - 40, 5 * - col0 * col2 );
  - name: tab2

outputs:
